import React, { useEffect, useState } from 'react'
import { Loading } from './Loading';

export const Hooksproject = () => {
    const [user,setUser] =useState([]);
    const [loading,setLoading] =useState(true);
    const getUser=async ()=>{
        try {
            const res=await fetch('https://api.github.com/userst');
            setLoading(false);
            setUser(await res.json());
        } catch (error) {
            setLoading(false);
        }
    
    }
    useEffect(()=>{
     getUser();   
    },[]);
    
    if(loading)
    {
        return <Loading/>
    }
  return (
    <>
  <h2>List of user</h2>
  <div className='container-fluid mt-5'></div>
  <div className="row">
    {
        user.map((current)=>{
          return(
            <div>
                <div className="container" key={current.id}>
                    <div className="row">
                        <div className="login" style={{display:'flex', justifyContent:'space-between'}}>{current.login}
                        <div className="colum">
                            {current.node_id}
                        </div>
                        </div>
                    </div>
                </div>
            </div>
          )
        })
    }
  </div>
    </>
  )
}
